VALUES ('5601232010307', 'Flan Chino', 'amidon, stabilisateur (E410), épaississant (E407), sel, colorants (E102* et E129*), arôme (vanilline). Peut causer des effets négatifs sur l\'actjvité et l\'attention chez les enfants. Mode de preparation: Mélanger le contenu du sachet avec 3 cuilléres à soupe de sucre. Du 1/2 litre de lait nécessaire à la preparation du flan, retirez en une petite portion pour dissoudre la preparation. Mettez le reste du lait dans une casserole et portez à ébullition, puis ajoutez le melange dissoudre. Laisser bouillir pendant quelques minutes sans cesser de remuer. Retirez du feu, et versez dans un moule caramelisé, laissez refroidir. Produit sans GLUTEN. Adéquat aux personnes avec de la maladie coealiaque. À consommer de préference, avant la date indiqué sur l\'emballage. NO Lot: voir sur l\'emballage.', 'https://static.openfoodfacts.org/images/products/560/123/201/0307/front_fr.11.400.jpg', '3.8', '2.7', '16.1', '11.5', '0.2', '3.1', '0.2', '0.078740157480315', '', '1');

